import React, { Component } from "react";
export default class Section9 extends Component {
    render() {
        return(
            <section>
                <div id="miniTitleSection9">- WE WORK WITH THE BEST</div>
                <div id="contentSection9">Have you ever wanted to impress your audience at first sight? Our studio uses modern technologies and extensive opportunities for photo and video shooting in action. We work with ambitious brands to create a meaningful image so that you can make the best impression.</div>
                <div id="name">- John Black</div>
                <div id="occupation">CEO & Inspirer of Ideas</div>
            </section>
        );
    }
}
